channel_description:
The official public health information Youtube channel of the World Health Organization (WHO)  

WHO Mission: Providing leadership on global health matters - Shaping the health research agenda - Setting norms and standards - Articulating evidence-based policy options -  Providing technical support to countries and monitoring - Assessing health trends. WHO has six regional offices and 147 country offices.

WHO reserves the right to delete comments that are: offensive or abusive, including aggressing a third-party organization or individual; containing anger, hate and/or violence; containing personal defamatory; ; considered as third-party promotion or marketing; including links to third-party web sites; spamming the conversations; inappropriately long; containing personal information, such as names, addresses, e-mail addresses or phone numbers; are out of context of the post on which they were posted;
